import { useEffect, useState} from 'react';
import './App.css';
import Table from './Table/Table';


function App() {
  const [data, setData] = useState([])
  const [columns, setColumns] = useState([])

  const loadingData = () => {

    setColumns( {
      Municipio_Ano_Tipo: 'Ano - Tabela',
      JAN: 'Janeiro',
      FEV: 'Fevereiro',
      MAR: 'Março',
      ABR: 'Abril',
      MAI: 'Maio',
      JUN: 'Junho',
      JUL: 'Julho',
      AGO: 'Agosto',
      SET: 'Setembro',
      OUT: 'Outubro',
      NOV: 'Novembro',
      DEZ: 'Dezembro'
    })
    return setColumns

    setData({
      Municipio_Ano_Tipo: 'Ano - Tabela',
      JAN: 'Janeiro',
      FEV: 'Fevereiro',
      MAR: 'Março',
      ABR: 'Abril',
      MAI: 'Maio',
      JUN: 'Junho',
      JUL: 'Julho',
      AGO: 'Agosto',
      SET: 'Setembro',
      OUT: 'Outubro',
      NOV: 'Novembro',
      DEZ: 'Dezembro'
    })
  }

  useEffect(() => {
    loadingData()
  }, [])

  return (
    <div className='App'>
      <Table columns={columns} data={data} />
    </div>
  )
}

export default App;
